import React from 'react'
import CatTechNote from './CatTechNote'

export default function CatTechNotes({catTechnique, handleDeleteCatTechNote, editCatTechNote}) {
    return (
        <div>
             {
            catTechnique.notes.map(catTechNote => {
                return <CatTechNote key={catTechNote.noteID} handleDeleteCatTechNote={handleDeleteCatTechNote} editCatTechNote={editCatTechNote} catTechnique={catTechnique} catTechNote={catTechNote}/>;
            })
            }
        </div>
    )
}
